INSERT INTO `contents` (`id`, `title`, `description`, `meta_title`, `meta_keyword`, `meta_description`, `created_at`, `updated_at`) VALUES
(1, 'Home', '<h1 style=\"text-align:center\">INDUSTRIAL DUST POLLUTION CONTROL SYSTEMS</h1>\r\n\r\n<h3 style=\"text-align:center\">QUALITY ENGINEERING IN MOST ECONOMIC WAY</h3>\r\n\r\n<h4>Choosing the best dust suppression solution is now simplest with us</h4>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<p>When it comes to suppressing dust, there&#39;s no such thing as a &#39;one size fits all&#39; solution. Identifying the right approach from the numerous choices available requires careful consideration of several key factors. REDSHIFT has experience in guiding clients in the right choice of dust suppression method in environments such as mines, construction sites, quarries, concrete plants, waste transfer stations and conveyor discharge sites. In doing so, we&#39;ve helped our clients to significantly improve workplace safety, reduce wear and tear on equipment, and improve community relations by eliminating or reducing dust in the vicinity. Draw on our expertise in this vitally important area and choose the best dust suppression method for your specific dust problem.</p>\r\n</div>\r\n\r\n<div class=\"col-md-12\"><a href=\"#\">Numerous types of spray nozzles</a></div>\r\n\r\n<div class=\"col-md-12\">\r\n<p>Now available from Redshift Environmental . Dry Fog nozzles are useful in a varieties&nbsp;of applications such as dust suppression, cooling, odour control and humidification.</p>\r\n</div>\r\n\r\n<div class=\"col-md-12\">\r\n<h4 style=\"text-align:center\">&nbsp;</h4>\r\n\r\n<p>In&nbsp;addition to that, We offer complete engineering solution which includes design engineering and supply,commissioning,project erection, servicing for pollution control system, dust suppression system, service water system, drinking water system, cooling water system, stock pile sprinkling system, firefighting system, fire detection system, hydraulic systems for material handling plants(coal, coke,lignite, bauxite handling plants) with complete auto and manual operations. We also provide solutions for sanitary, water supply and drainage jobs along with specialized with fire fighting for industrial, commercial and residential buildings. We also work as a turnkey projects supplier for national and international projects solely or in consortium.</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:14px\">We are also specialized in pipe line design for various industry (oil, gas etc.) and solution for water and compressed systems.Our team includes very experienced engineers with professional team of officials for all sorts of enquiries.</span></p>\r\n\r\n<p style=\"text-align:center\">Every system we do in tailer made ways&nbsp;according to cater the specific need of the client .</p>\r\n\r\n<p><strong>Portable Ambient Air Quality Monitor-</strong></p>\r\n\r\n<p><strong>Complete system is available with us ..</strong></p>\r\n\r\n<hr />\r\n<div class=\"row\" style=\"box-sizing: border-box; margin-right: -15px; margin-left: -15px; font-family: Roboto-Light, &quot;Helvetica Neue&quot;, Helvetica, Arial; font-size: 14px;\">\r\n<div class=\"col-sm-7\" style=\"box-sizing: border-box; position: relative; min-height: 1px; padding-right: 15px; padding-left: 15px; float: left; width: 703.707px;\">\r\n<p><span style=\"font-family:roboto-regular; font-size:17px\">Our Mission</span></p>\r\n\r\n<p>we provide highly values our clients&rsquo; needs for safe, reliable, and operationally efficient designs through cost-effective engineering and management services in a responsive, dynamic, and efficient way. Our Principals have built their careers understanding this truth and developed confidence and trusted, long-lasting relationships within the industry by conducting our business with integrity, honesty, and hard work.<br />\r\nOur Mission Statement: To provide responsive, safe, and trusted solutions to our clients with the highest-quality, most dependable, cost-effective engineering, design and construction management services in the energy industry.</p>\r\n\r\n<p><span style=\"font-family:roboto-regular; font-size:17px\">Our Vision</span></p>\r\n\r\n<p>Our vision for REDSHIFT ENVIRONMENTAL SYSTEMS (INDIA) PVT.LTD. who we are, individually and as a company, and reflects our core values and the path we follow in pursuit of providing our clients with unmatched performance, unparalleled accountability, and the highest-level of satisfaction in the industry. To build trusted relationships and serve our clients through integrity, honesty, hard work and accountability in a collaborative, solution-oriented environment focused on providing the right solution instead of the easy solution, in the most efficient and cost-effective way possible.</p>\r\n\r\n<p><span style=\"font-family:roboto-regular; font-size:17px\">Our Values</span></p>\r\n\r\n<p>our values are the cornerstone of how we do business and the basis for our guiding principles and the culture of the company. They set the benchmark for minimum expectations and are the driving force behind our clear communication, superior performance, and professional integrity</p>\r\n\r\n<ul>\r\n	<li style=\"text-align:left\">Integrity</li>\r\n	<li style=\"text-align:left\">Accountability</li>\r\n	<li style=\"text-align:left\">Reliability</li>\r\n	<li style=\"text-align:left\">Efficiency</li>\r\n	<li style=\"text-align:left\">Quality</li>\r\n	<li style=\"text-align:left\">Safety</li>\r\n	<li style=\"text-align:left\">Innovation</li>\r\n	<li style=\"text-align:left\">Collaboration</li>\r\n	<li style=\"text-align:left\">Customizable Solutions</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-4\">\r\n<div class=\"right-bar-sec\">\r\n<div class=\"col-md-12\">\r\n<div class=\"row\">\r\n<h3>&nbsp;</h3>\r\n</div>\r\n\r\n<div class=\"row\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'Home', 'Home', 'Home', '2019-06-15 01:34:48', '2020-01-06 21:55:38'),
(2, 'about us', '<h1>About Us</h1>\r\n\r\n<p>REDSHIFT ENVIRONMENTAL SYSTEMS (I) PVT.LTD.&nbsp;Specialist in providing dust pollution control system&nbsp;solutions you can rely on.</p>\r\n\r\n<p>REDSHIFT ENVIRONMENTAL SYSTEMS (I) PVT.LTD. is a fast growing Engineering company with a strong reputation in the area of dust pollution control system design engineering and supply along with complete supervision of erection &amp; commissioning .</p>\r\n\r\n<p>We advise, we design and we develop dust pollution&nbsp;solutions for a wide variety of industries like mining, construction, recycling plants etc.We offer complete engineering solution which includes Design Engineering and supply, erection commissioning, Servicing for dust pollution control systems, supply of required sprares ,Dust extraction systems,dust suppression systems,service water ,&nbsp;service air / plant cleaning systems , drinking water system ,cooling water systems,Stock yard sprinkling systems<br />\r\nFire fighting systems,Fire detection and alarm system , Hydraulic systems , pneumatic systems for Coal , Coke , lignite , bauxite handling plants&nbsp; with complete auto and manual operations. We also provide solutions for sanitary, water supply and drainage jobs along with specialized with fire fighting for industrial, commercial and residential buildings.</p>\r\n\r\n<p>We also work as a turnkey project&nbsp;supplier for national and international projects solely or in consortium. Presently, we are executing orders for Coal handling plants&nbsp;received from various reputed clients. We have a competent team of qualified Engineers of all streams who look after every stage of activity from design to manufacturing, quality control and upto complete execution of the project. A highly qualified team of innovative Design Engineers are engaged to take care of the individual needs of each customer. Computer aided design facilities with drafting station and Software Programmes form part of design innovation. We have a well-equipped modern Machine Shop, which includes Heat Treatment, Precision Grinding and Fabrication facilities of all description including Sheet Metal work. Our Quality Assurance Programmes operates under guidelines, which meets the most stringent Quality Control requirements utilizing own QA team, testing provisions and instruments.</p>\r\n\r\n<p>As a growing company, we are always interested in talking to people who are passionate about finding the right dust pollution&nbsp;solutions .</p>\r\n\r\n<p>Contact REDSHIFT today if you are passionate about helping clients find dust pollution&nbsp;solutions with&nbsp;value ethics, honesty and reliability in most economic ways.</p>', 'about us', 'about us', 'about us', '2019-06-15 01:38:33', '2019-07-13 18:22:00'),
(6, 'Career', '<h1>Careers</h1>\r\n\r\n<p><strong>Work with REDSHIFT : Specialists in providing dust suppression solutions you can rely on</strong></p>\r\n\r\n<p>REDSHIFT ENVIRONMENTAL SYSTEMS (I) PVT.LTD. is a fast growing Technical Specialist company with a strong reputation in the area of dust suppression and all types of industrial dust pollution control systems.</p>\r\n\r\n<p>We advise, we design and we develop dust suppression solutions for a wide variety of industries like mining, construction, recycling plants etc.</p>\r\n\r\n<p>As a growing company, we are always interested in talking to people who are passionate about finding the right dust suppression solutions for our clients.</p>\r\n\r\n<p>Prospective employees must be highly ethical, honest and reliable.</p>\r\n\r\n<p><a href=\"http://redshiftenvironmentalsystems.com/contact-us\">Contact REDSHIFT&nbsp;today</a> if you are passionate about helping clients find dust suppression solutions and value ethics, honesty and reliability.</p>', 'Career', 'Career', 'Career', '2019-06-15 10:25:46', '2019-07-08 22:05:51'),
