(6, 'Dust Suppression Systems', '<p>Dust Suppression Systems include the following types of systems:</p>\r\n\r\n<p>1. Plain water dust suppression systems</p>\r\n\r\n<p>2. Mist spray dust suppression systems</p>\r\n\r\n<p>3. High pressure water fogging systems</p>\r\n\r\n<p>4. Dry fog dust suppression systems</p>\r\n\r\n<p>along with the above systems all the associated equipments are available with us.</p>\r\n\r\n<p>We are specialised in design Engineering and supply along with supervision of erection commissioning of all the above systems.</p>', 'Dust Suppression Systems', 'Dust Suppression Systems', 'Dust Suppression Systems', 1, '2019-06-15 05:29:11', '2019-07-09 21:51:33'),
(7, 'Spray nozzles', '<p>Spray nozzles&nbsp;&nbsp;</p>\r\n\r\n<p>A numerous types of Spray nozzles are available with us for industrial and irrigation systems use such as:</p>\r\n\r\n<p>1) Plain water nozzles&nbsp;</p>\r\n\r\n<p>2) Mist spray fogging nozzles</p>\r\n\r\n<p>3) Dry fog dust suppression system nozzles(in different varities)</p>\r\n\r\n<p>4) Air nozzles for service air and pneumatic cleaning system</p>\r\n\r\n<p>5) High pressure Water spray nozzles</p>\r\n\r\n<p>6) Multple tip nozzles&nbsp;</p>\r\n\r\n<p>7) Spray headers with complete accessories for dust suppression systems</p>\r\n\r\n<p>8) Complete design and selection of spray nozzles by experts is done by us as per specific requirement of client</p>\r\n\r\n<p>&nbsp;</p>', 'Spray nozzles', 'Spray nozzles', 'Spray nozzles', 1, '2019-07-09 21:58:02', '2019-07-09 21:58:02'),
(8, 'Sprinkling System', '<p>Sprinkling System:</p>\r\n\r\n<p>The system is one of the most important systems offered by REDSHIFT ENVIRONMENTAL SYSTEMS (INDIA) PVT.LTD. as it is directly connected with the tharmal power generation.</p>\r\n\r\n<p>The system is recommeded to be used for all coal stock yards at the power plants. The stockpiles are provided with the system in AUTO /MANUAL mode of operation as per clent&#39;s need and specification.</p>\r\n\r\n<p>complete design &amp; engineering along with supply and supervision of erection commissioning is done by us against enquiry .</p>', 'Sprinkling System', 'Sprinkling System', 'Sprinkling System', 1, '2019-07-09 22:04:08', '2019-07-09 22:04:08'),
(9, 'Fire Hydrant systems', '<p>Fire Hydrant system:</p>\r\n\r\n<p>Complete design engineering ,manufacturing and supply along with supervision of erection commissioning is done by us.</p>', 'Fire Hydrant systems', 'Fire Hydrant systems', 'Fire Hydrant systems', 1, '2019-07-09 22:04:57', '2019-07-10 20:27:31'),
(10, 'Fire detection and alarm system', '<p>Fire detection and alarm system:</p>\r\n\r\n<p>Complete design engineering ,manufacturing and supply along with supervision of erection commissioning is done by us.</p>', 'Fire detection and alarm system', 'Fire detection and alarm system', 'Fire detection and alarm system', 1, '2019-07-09 22:05:40', '2019-07-10 20:27:45'),
(11, 'Dust Extraction Systems', '<p>Dust Extraction System is one of the most useful dust pollution control systems . We provide it with bag filter with ID fans as per clients specific requirement. Each of the equipment spares such as filter bags , filter cages , solenoid valves , sequential timer panel etc all are requler supply items for us.</p>\r\n\r\n<p>For fine dust we recommend cyclone sparator to be used by the clients.</p>\r\n\r\n<p>Complete design engineering ,manufacturing and supply along with supervision of erection commissioning is done by us.</p>\r\n\r\n<p>&nbsp;</p>', 'Dust Extraction Systems', 'Dust Extraction Systems', 'Dust Extraction Systems', 1, '2019-07-09 22:06:18', '2019-07-10 20:27:16'),
(12, 'Water spray systems for sports fields', '<p>Water spray systems for sports fields:</p>\r\n\r\n<p>Complete design engineering ,manufacturing and supply along with supervision of erection commissioning is done by us.</p>', 'Water spray systems for sports fields', 'Water spray systems for sports fields', 'Water spray systems for sports fields', 1, '2019-07-09 22:07:09', '2019-07-10 20:28:00'),
(13, 'Watering systems for irrigation fields', '<p>Watering systems for irrigation fields:</p>\r\n\r\n<p>Complete design engineering ,manufacturing and supply along with supervision of erection commissioning is done by us.</p>', 'Watering systems for irrigation fields', 'Watering systems for irrigation fields', 'Watering systems for irrigation fields', 1, '2019-07-09 22:07:48', '2019-07-10 20:28:16'),
(14, 'Supply of spares for all utility systems', '<p>Supply of spares for all utility systems :</p>\r\n\r\n<p>Complete design engineering ,manufacturing and supply along with supervision of erection commissioning is done by us.</p>', 'Supply of spares for all utility systems', 'Supply of spares for all utility systems', 'Supply of spares for all utility systems', 1, '2019-07-09 22:08:24', '2019-07-10 20:28:48'),
(15, 'Ventilation systems', '<p>Ventilation systems:</p>\r\n\r\n<p>Complete design engineering ,manufacturing and supply along with supervision of erection commissioning is done by us.</p>', 'Ventilation systems', 'Ventilation systems', 'Ventilation systems', 1, '2019-07-09 22:18:27', '2019-07-10 20:29:05');
